import * as THREE from "three";
import classes from "./Skeleton.module.scss";

const Skeleton = (props) => {
    return(
        <mesh>
            <boxBufferGeometry attach="geometry"/>
            <meshLambertMaterial attach="material" color="purple"/>
        </mesh>
    )
};
export default Skeleton;
